import React from "react";

export const Navbar = () => {
  return (
    <div>
      <nav className="navbar bg-body-tertiary">
        <div className="container">
          <a className="navbar-brand" href="#">
            <img
              src="logo.png"
              alt="Bootstrap"
              width={30}
              height={24}
            />
          </a>
        </div>
      </nav>
    </div>
  );
};
